import "./card.sass"
const Card = ({url, room, floor, size, price, address}) => {
    return(
        <div className="card">
            <div className="card__image">
                    <img src={url} alt="" />
            </div>
            <div className="details">
                    <div className="details__item">{room}.</div>
                    <div className="details__item">{size}<sup>2</sup></div>
                    <div className="details__item">{floor}</div>
            </div>
            <div className="card__price">
                {price}
            </div>
            <div className="card__address">
                {address}
            </div>
        </div>
    )
}
export default Card;
